  // ]);

  return (

        <div className="tickets-item" key={key}>
                    <div className="tickets-item-header">
                        <p>13 400 Р</p>
                        <img src={ s7 } alt="s7-logo" />
                    </div>
                    <div className="tickets-item-details">
                        <p>MOW-HKT<br /><span>10:45 - 08.00</span></p>
                        <p>В ПУТИ<br /><span>21ч 15м</span></p>
                        <p>БЕЗ ПЕРЕСАДОК</p>
                    </div>
            </div>
  )
}

